def relative_moduli(K0, mu0, l0, m0, n0, K1, mu1, l1, m1, n1, c=0):
    K_rel = -(((K0 - K1)*(3*K0 + 4*mu0))/(3*c*(K0 - K1) + 3*K1 + 4*mu0))
